dict_data = {}
jsonData = self.utility.json_file_reader()
for item in jsonData['assets']:
    dict_data = {'url': item['chromedriver']['url'], 'release_version':
        item['chromedriver']['release_version'], 'mac_v_64': item[
        'chromedriver']['mac_v_64'], 'linux_v_64': item['chromedriver'][
        'linux_v_64']}
return dict_data
